@Quo_vadis_BRD @StephanThomae @c_lindner @MarcoBuschmann @_MartinHagen @cad59 @EUTheurer @MAStrackZi Zwei Punkte:
1) keiner weiss wie lange ein Impfschutz im Mittel gegen VOC Omicron anhält.
