@SchulenSchnell @Leopoldina „… ein Vorziehen der Weihnachtsferien.
Eine Aussetzung der Präsenzpflicht und ein Wechselunterricht an Schulen sowie die Schließung von
Kitas sollten möglichst vermieden werden.“ schon ein wenig widersprüchlich. Teil 2 kann ich klar zustimmen.(kein Aussetzen der Präsenzpflicht)

@AryaBlack73 @AdeleIndo @realTomBohn Nochmal:
1) Impfstoff mRNA hoch effektiv gegen Krankheit. Impfdosen stand heute werden drei benötigt.
2) Nebenwirkungen sind IMMER zu erwarten, in unterschiedlicher Höhe und Grades. Die Nebenwirkungen sind nichts im Vergleich zum Nutzen. 3) Lassen Sie sich gut beraten.

@s_steffche @BergheimJeff Das ist Quatsch. Schauen sie bitte die Publikationen an. &gt;13% Sterblichkeit bei Personen über 80.
Weit unter 0,1% bei 20 Jährigen.
Schützen geht. Einfach zu negieren zeugt von Hilflosigkeit.

@gjonitz @VorsitzenderNAV Nicht die Präanalytik mit aktuellen Intensivbelegzahlen zusammen würfeln. 
DIVI Zahlen zweifelt hoffentlich keiner an.
RKI Zahlen braucht man nicht bezweifeln. Denn die Methodik der Testungen sind wichtig.

